import StoragePowerTable from "../components/StoragePowerTable";
import { DataTile } from "../components/DataTile";

export const Home = (props) => {
  return (
    <>
      <StoragePowerTable />
      <DataTile>
        <p>11.2 PiB</p>
        <p>Total Capacity</p>
      </DataTile>
    </>
  );
};

export default Home;
